import React, { Component } from 'react';

import infoData from './pages/homepage/info.json'
import './App.css'

var dataList = infoData;

export default class Data1 extends Component {
    render(){
        return(
            <ul>
            {
                dataList.map((s)=>{
                    console.log(s)
                    return(
                        <div>
                            <div>
                                <div> {s.productImage}</div>
                            </div>
                        </div>
                    )
                })
            }
            
            </ul>
        )
    
        }}
